function cc_resolver(e,r){for(var t=e.body.querySelectorAll("template"),l=0,o=t.length;l<o;l++)for(var c=t[l],n=c.content.querySelectorAll("c-c[href],carbon-copy[href]"),a=0,f=n.length;a<f;a++){var u=n[a],b=u.getAttribute("href"),h=b.split("#"),s=r.absolute(r._absUrl,h[0]);u.setAttribute("href",s+"#"+h[1])}return e}